import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element and click to open
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the remove item button and click it
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');

    // Take a screenshot after removing the item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_removed.png'));

    // Verify item removal by checking for empty cart message
    const isEmptyCart = await page.isVisible('.empty-cart', { timeout: 5000 });

    return {
      success: true,
      action: "Removed item from cart",
      extractedData: { isEmptyCart },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
